import React from 'react';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom'
import {render} from 'react-dom';
import Register from './components/Register/Register';

render(
  <BrowserRouter>
    <App />
    <Register />
  </BrowserRouter>,
  document.getElementById('root')
);
